import './TextInput.css';

export const TextInput = ({label, ...props}) => {
    return (
        <div>
            <form className="form">
                <label style={{marginLeft:1}}> 
                    {label}
                </label>
                <input type='text'></input>
            </form>
        </div>
    )
}

export default TextInput;
